import { Button, FormControlLabel, TextField } from '@mui/material';
import Box from '@mui/material/Box';
import Checkbox from '@mui/material/Checkbox';
import React from 'react';


const Form = () => {
    function RedBar() {
        return (
          <Box
            sx={{ height: 20, backgroundColor: 'transparent' }}
          />
        );
    }

  return (
    <div className="form">
    <div className="form__content">
    <div className="form__details">
        <h2>Create an account</h2>
      <form>
        <RedBar/>
        <div className="form--text">
        <label htmlFor="email">Your email Address</label>
        <input type="text" id="email" name="email" placeholder="Enter your Email Address" />
        </div>
        <RedBar/>
        <div className="form--text">
        <label htmlFor="password">Your password</label>
        <input type="password" id="password" name="password" placeholder="Enter your password" />
        </div>    
        <RedBar/><div className="form--text">
        <label htmlFor="cpass">Confirm your password</label>
        <input type="password" id="cpass" name="cpass" placeholder="Enter your password" />
        </div>
        <RedBar/>    
        <div className="form--text">
        <label htmlFor="name">Your name</label>
        <input type="text" id="name" name="name" placeholder="Enter your Name" />
        </div>
        <RedBar/>
        <div className="form--text">
        <label  htmlFor="phone">Your phone number</label><br/>
        <input type="number" id="phone" name="phone" placeholder="Enter your Phone Number" />
        </div>
        <RedBar/>
        <FormControlLabel
          value="end"
          control={<Checkbox defaultChecked />} label="I read and agree Terms and Conditions" size="small" 
          labelPlacement="end"
          sx={{ 
            color: 'black',
            '& .MuiTypography-root': {
              fontWeight: "bold",
            },
          }}
        />
        <RedBar/>
        <Button type='submit' variant='contained' color='primary'>Create Account</Button>
      </form>
    </div>
    </div>
    </div>
  )
}

export default Form;
